public function getTipoviMlekaAttribute($value)
{
    return array_map(function ($name) {
        foreach (TipMleka::cases() as $case) {
            if ($case->name === strtoupper($name)) {
                return $case->value;
            }
        }
        return null;
    }, explode(',', $value));
}

